import data from "../data.json"

const newData = data.map( (data) => {
    return (
        <li className="elementCard" key= {data.id}>
        <img src={data.cover} alt='' className="cover"/>
        <p className="titre">{data.title}</p>
        </li>
    )
})

export default newData;
